DROP TABLE IF EXISTS DSETTINGVALUE;
DROP TABLE IF EXISTS DCONFIGSETTING;
DROP TABLE IF EXISTS PCONFIGPARAM;
DROP TABLE IF EXISTS CCOMPONENT;
DROP TABLE IF EXISTS HSTATUSUPDATE;
DROP TABLE IF EXISTS DFORM;
DROP TABLE IF EXISTS CFORMSTATUS;
DROP TABLE IF EXISTS CFORMTYPE;
DROP TABLE IF EXISTS TSEQUENCE;

CREATE TABLE CCOMPONENT ( IDCOMPONENT int NOT NULL COMMENT 'ID of component, used as foreign key. This ID will be assigned to each component at deployment as they are known at design time and will not change at runtime.', NMCOMPONENT varchar(64) NOT NULL COMMENT 'The name of this component.', PRIMARY KEY (IDCOMPONENT) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE CFORMSTATUS ( IDFORMSTATUS smallint NOT NULL, STCODE smallint, DSCFORMSTATUS char(255) NOT NULL, PRIMARY KEY (IDFORMSTATUS) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE CFORMTYPE ( IDFORMTYPE smallint NOT NULL, DSCFORMTYPE char(64), PRIMARY KEY (IDFORMTYPE) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE DCONFIGSETTING ( IDCONFIGSETTING int NOT NULL, IDPARAM int NOT NULL COMMENT 'Unique ID of setting. This ID will be generated using the TSEQUENCE table with IdSequence = "idconfigparam".', DTVALIDFROM datetime NOT NULL COMMENT 'What date/time this parameter becomes valid.', DTVALIDTO datetime COMMENT 'What date/time this parameter becomes invalid.', LOGMODIFIEDBY char(8) COMMENT 'This contains the username of the administrator that modified this parameter last, if any.', DTCREATED datetime NOT NULL, PRIMARY KEY (IDCONFIGSETTING), INDEX FK_PARAMSETTING_IDCONFIGPARAM (IDPARAM) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE DFORM ( IDFORM int NOT NULL COMMENT 'ID of this draft application. This ID will be generated using the TSEQUENCE table with IdSequence = "iDFORM".', IDOFFICE char(2) NOT NULL COMMENT 'WIPO ST.3 office code for this application. Always constant for a particular office.', IDFILING char(19) COMMENT 'Filing Number assigned to the Application by the FSP Front Office. It is constructed as follows:
            
            "EF" + IdOffice (2 digits) + Year (4 digits) + IDFORM (left-padded to 11 digits)', TYAPPLICATION smallint NOT NULL, IDAPPLICATION char(17) COMMENT 'Application Number built according to ST 13 format  and assigned to the Application by the PO Back Office, after it receives the filing. This value might be received by FSP after the BO process the application, but it is not mandatory.', IDPAYMENT char(32) COMMENT 'Identifier used as a reference for payment via external platforms.
            Necessary size depends on payment system used and will be set at deployment time.', IDSTATUS smallint NOT NULL COMMENT 'Current status of the application. It corresponds to the latest status available for this application in the DStatus table (column StForm). It is stored also in the DFORM table for performance reasons.', LOGUSERNAME char(8) COMMENT 'Username of the registered user owning this application, if any.', DTCREATED datetime NOT NULL COMMENT 'Date this draft application was started. Default value is the current date.', PRIMARY KEY (IDFORM), INDEX FK_FORMTYPE_IDFORMTYPE (TYAPPLICATION), INDEX FK_FORMSTATUS_IDFORMSTATUS (IDSTATUS) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE DSETTINGVALUE ( IDVALUE int NOT NULL COMMENT 'Unique ID of value. This ID will be generated using the TSEQUENCE table with IdSequence = "idvalue".', IDCONFIGSETTING int NOT NULL, TXTVALUE longtext COMMENT 'The parameter value.', DTCREATED datetime, PRIMARY KEY (IDVALUE), INDEX FK_SETTINGVALUE_IDSETTING (IDCONFIGSETTING) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE HSTATUSUPDATE ( IDSTATUS int NOT NULL COMMENT 'ID of the status record. This ID will be generated using the TSEQUENCE table with IdSequence = "idstatus".', IDFORM int NOT NULL COMMENT 'The draft application this status update belongs to.', IDFORMSTATUS smallint NOT NULL COMMENT 'The status code.', TXTMESSAGE varchar(255) COMMENT 'Possible message belonging to the status change, e.g. in case of an error.', DTCREATED datetime NOT NULL COMMENT 'The date when this status was set, i.e. when the draft application had its status changed.', PRIMARY KEY (IDSTATUS), INDEX FK_FORMSTATUS_IDFORM (IDFORM), INDEX FK_STATUSUPDATE_IDFORMSTATUS (IDFORMSTATUS) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE PCONFIGPARAM ( IDPARAM int NOT NULL COMMENT 'Unique ID of setting. This ID will be generated using the TSEQUENCE table with IdSequence = "idconfigparam".', IDCOMPONENT int NOT NULL COMMENT 'Id of the component this parameter belongs to.', NMPARAM varchar(64) NOT NULL COMMENT 'The name of this parameter.', DSCPARAM varchar(255) COMMENT 'A description of this parameter.', TYPARAM smallint NOT NULL COMMENT 'This defines the type of parameter:
            0 = simple
            1 = list
            2 = XML
            3 = object
            
            ', PRMSOURCE smallint NOT NULL COMMENT 'This contains "0" in case the value contains a file path, and "1" or NULL in case the value is the actual data. Used for XML parameters.', ISHIDDEN smallint DEFAULT '0' NOT NULL COMMENT 'Whether this parameter is hidden from the administration tool web page.
            0 = false
            1 = true', PRIMARY KEY (IDPARAM), INDEX FK_COMPONENTPARAM_IDCOMPONENT (IDCOMPONENT) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
CREATE TABLE TSEQUENCE ( IDSEQUENCE varchar(64) NOT NULL COMMENT 'Name of the sequence, the value assigned will be the name of the PK field in lowercase. E.g. "iDFORM", "idconfigparam".', NRLASTVALUE int DEFAULT '0' NOT NULL COMMENT 'The last value used for the specific sequence entry. Default value at creation will be 0. The generation of the values will be managed by the Persistence Layer.', PRIMARY KEY (IDSEQUENCE) ) ENGINE=InnoDB DEFAULT CHARSET=latin1;
ALTER TABLE DCONFIGSETTING ADD CONSTRAINT FK_PARAMSETTING_IDCONFIGPARAM FOREIGN KEY (IDPARAM) REFERENCES PCONFIGPARAM (IDPARAM);
ALTER TABLE DFORM ADD CONSTRAINT FK_FORMSTATUS_IDFORMSTATUS FOREIGN KEY (IDSTATUS) REFERENCES CFORMSTATUS (IDFORMSTATUS) ;
ALTER TABLE DFORM ADD CONSTRAINT FK_FORMTYPE_IDFORMTYPE FOREIGN KEY (TYAPPLICATION) REFERENCES CFORMTYPE (IDFORMTYPE);
ALTER TABLE DSETTINGVALUE ADD CONSTRAINT FK_SETTINGVALUE_IDSETTING FOREIGN KEY (IDCONFIGSETTING) REFERENCES DCONFIGSETTING (IDCONFIGSETTING);
ALTER TABLE HSTATUSUPDATE ADD CONSTRAINT FK_FORMSTATUS_IDFORM FOREIGN KEY (IDFORM) REFERENCES DFORM (IDFORM) ;
ALTER TABLE HSTATUSUPDATE ADD CONSTRAINT FK_STATUSUPDATE_IDFORMSTATUS FOREIGN KEY (IDFORMSTATUS) REFERENCES CFORMSTATUS (IDFORMSTATUS);
ALTER TABLE PCONFIGPARAM ADD CONSTRAINT FK_COMPONENTPARAM_IDCOMPONENT FOREIGN KEY (IDCOMPONENT) REFERENCES CCOMPONENT (IDCOMPONENT);
